import React, {Component} from 'react'

export default class Donut extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        series: [44, 55, 41, 17, 15],
        options: {
          chart: {
            type: 'donut',
          },
          responsive: [{
            breakpoint: 480,
            options: {
              chart: {
                width: 200
              },
              legend: {
                position: 'bottom'
              }
            }
          }]
        },
    }
}
}
